import React from "react";

const ResumeAnalyzer = () => {
  return (
    <div className="min-h-screen bg-gray-50 ">
      <h1 className="text-3xl font-bold text-green-700 mb-6">Resume Analyzer</h1>
      <p className="text-gray-700 mb-4">
        Here you can upload your resume and get feedback to improve it for placements.
      </p>
      {/* Example content */}
      <div className="border border-gray-300 p-4 rounded-lg bg-white shadow-sm">
        <p className="text-gray-600">Feature coming soon: Upload and analyze your resume!</p>
      </div>
    </div>
  );
};

export default ResumeAnalyzer;
